import React from "react";
import "./booknow.css";
import { Link } from "react-router";
import Hauptseite from "../pages/Hauptseite";

const Booknow = () => {
    return (
        <div className="booknow">
                <button type="button" Link to= "/" element = {<Hauptseite/>}>Jetzt buchen</button>
        </div>
    );
}
export default Booknow;
